import React from "react";
import "./footer.css";

const Footer = () => {
  return (
    <>
      <footer>
        <div className="footer-top">
          <FooterSection1
            FooterHeading={"About Us"}
            footerPara={
              "Lorem ipsum is placeholder text commonly used to demonstrate the visual form of a document."
            }
            i1={"fa-brands fa-facebook-f"}
            i2={"fa-brands fa-instagram"}
            i3={"fa-brands fa-youtube"}
          />
          <FooterSection2
            FooterHeading={"Company"}
            li1={"Home"}
            li2={"About"}
            li3={"Contact Us"}
            li4={"Services"}
            li5={"Our Team"}
          />
          <FooterSection2
            FooterHeading={"Services"}
            li1={"Artical Management"}
            li2={"About"}
            li3={"Contact Us"}
            li4={"Services"}
            li5={"Our Team"}
          />
        </div>
      </footer>
    </>
  );
};
export default Footer;

function FooterSection1(props) {
  return (
    <>
      <div className="footersec">
        <h3>{props.FooterHeading}</h3>
        <div className="bar-red"></div>
        <div className="footer-para">
          <p>{props.footerPara}</p>
        </div>
        <div className="footer-icon-container">
          <div className="footer-icon">
            <i class={props.i1}></i>
          </div>
          <div className="footer-icon">
            <i class={props.i2}></i>
          </div>
          <div className="footer-icon">
            <i class={props.i3}></i>
          </div>
        </div>
      </div>
    </>
  );
}
function FooterSection2(props) {
  return (
    <>
      <div className="footersec">
        <h3>{props.FooterHeading}</h3>
        <div className="bar-red"></div>
        <ul>
          <li>{props.li1}</li>
          <li>{props.li2}</li>
          <li>{props.li3}</li>
          <li>{props.li4}</li>
          <li>{props.li5}</li>
        </ul>
      </div>
    </>
  );
}
